import About from "./About/About";
import Intro from "./intro/intro";
import ProductList from "./productList/productList";
import {Route} from 'react-router-dom';


function App() {
  return (
    <div>
      <Intro />
      <About />
      <ProductList/>
      <Route path='./about'>
        <About />
      </Route>
    </div>

  );
}

export default App;
